import Link from 'next/link';

export default () => (
    <div>
        <h1>About</h1>
        <Link href="/">Go to the home page</Link>
        <p>A JavaScript Programmer</p>
        <img src="/static/logo.png" alt="JS" height="200px"/>
    </div>
);
